    if cp != 'c' and cp != 'p':
        print(colored('PLEASE ENTER A "c" OR A "p" WHEN PROMPTED TO INDICATE THE TYPE OF INPUT', 'red'))
    if cp == 'p':
        init = init.replace('p.', '').lower()
        aa = ''.join(init.split())
        pos = list(map(int, re.findall(r'\d+', aa)))
        if aa[:3].isalpha():
            aa.lower()
            for key, value in aa_conv.items():
                aa = aa.replace(key, value)
        aa = aa.upper()
        val = p_valid(aa)
        if 'INVALID' in val:
            return val
        else:
            dom = pos[0] - 1
            if 'SPLICE' in aa:
                mut = 'splice'
                dom += 1
            elif '*' in aa and aa[0] != '*':
                mut = 'non'
            elif 'FS' in aa:
                mut = 'fs'
            elif 'DEL' in aa:
                mut = 'inf_del'
            elif 'INS' in aa:
                mut = 'inf_ins'
            else:
                mut = 'mis'
            return read_notch(mut, dom, aa)
    if cp == 'c':
        cdna = init
        if cdna.find('c.') != -1:
            cdna = cdna.replace(cdna[:cdna.find('c.')], '').replace('c.', '')
        cdna = cdna.replace(' ', '')
        pos = list(map(int, re.findall(r'-?\d+', cdna)))
        if len(pos) != 0:
            cdna = cdna.replace(cdna[:cdna.find(str(pos[0]))], '')
        seq = ''.join(re.findall(r'[ATGC]', cdna.upper()))
        val = c_valid(cdna)
        if 'INVALID' in val:
            return val

        inframe = False
        if 'delins' in cdna:
            if ((pos[len(pos) - 1] - pos[0] + 1) - len(seq)) % 3 == 0:
                inframe = True
        elif '>' not in cdna and len(seq) % 3 == 0:
            inframe = True

        # splice
        mod = [0, 0]
        if any(x in cdna for x in ['+', '-']) or (
                any(x == pos[len(pos) - 1] for x in range(1, len(c_exonb) - 1, 2)) and not inframe):
            mut = 'splice'
            if any(cdna.find(x) > 0 for x in ['+', '-']):
                try:
                    if any(cdna.find(x) < cdna.index('_') for x in ['+', '-']):
                        mod[0] = pos[1]
                        del pos[1]
                except ValueError:
                    mod[0] = pos[1]
                    del pos[1]
            if any(0 < cdna.find('_') < cdna.find(x) for x in ['+', '-']):
                mod[1] = pos[-1]
                del pos[-1]
            if pos[0] in c_exonb:
                g_pos = g_exonb[c_exonb.index(pos[0])]
                c_pos = pos[0]
            else:
                g_pos = g_exonb[c_exonb.index(pos[-1])]
                c_pos = pos[-1]
            first = g_pos - (c_pos - pos[0]) + mod[0] - 1
            last = g_pos - (c_pos - pos[-1]) + mod[1]
            if 'delins' in cdna:
                if len(seq) <= (last - first):
                    mod_full = notch_full[:first] + seq + '-' * ((last - first) - len(seq)) + notch_full[last:]
                if len(seq) > (last - first):
                    mod_full = notch_full[:first] + seq + notch_full[last:]
                    for x in range(g_exonb.index(g_pos) + 1, len(g_exonb), 1):
                        g_exonb[x] += len(seq) - (last - first)
            elif 'del' in cdna:
                mod_full = notch_full[:first] + '-' * len(seq) + notch_full[last:]
            elif 'ins' in cdna:
                mod_full = notch_full[:last - 1] + seq + notch_full[last - 1:]
                last += len(seq) - 1
                for x in range(g_exonb.index(g_pos) + 1, len(g_exonb), 1):
                    g_exonb[x] += len(seq)
            elif 'dup' in cdna:
                mod_full = notch_full[:last] + seq + notch_full[last:]
                last += len(seq)
                for x in range(g_exonb.index(g_pos) + 1, len(g_exonb), 1):
                    g_exonb[x] += len(seq)
            elif '>' in cdna:
                mod_full = notch_full[:first] + seq[1] + notch_full[last + 1:]
            recovery = 0
            if g_exonb.index(g_pos) % 2 == 0:
                for x in range(last, first, -1):
                    if mod_full[x] != '-' and (g_exonb[g_exonb.index(g_pos) + 1] - x + 1) % 3 == 1 and mod_full[
                                                                                                       x:x + 2] == 'AG':
                        recovery += 1
            else:
                for x in range(first, last, 1):
                    if mod_full[x] != '-' and (x - g_exonb[g_exonb.index(g_pos) - 1] + 1) % 3 == 1 and mod_full[
                                                                                                       x:x + 2] == 'GT':
                        recovery += 1
            dom = c_exonb[g_exonb.index(g_pos)]
            return str(recovery) + ' recoveries due to stronger variants\n' + read_notch(mut, dom, str(dom) + '_splice')

        if '>' in cdna:
            mod_cdna = notch_cdna[:pos[0]] + seq[1] + notch_cdna[pos[0]:]
            dom = (pos[0]) // 3
            orig = notch_aa[dom - 1]
            new = gencode[mod_cdna[(dom * 3) - 1:(dom * 3) + 2]]
            if seq[0] == seq[1]:
                return colored('INVALID INPUT: SILENT MUTATION DETECTED', 'red')
            if dom == 1:
                return 'Detected protein change: ' + orig + str(
                    dom) + new + '\nLoss of function? YES\nConfidence: HIGH\nEligibility: ' + colored(
                    'ELIGIBLE FOR NOTCH TRIAL', 'green')
            elif orig == '*':
                return 'EXTENSION MUTATION DETECTED - EFFECT UNKNOWN, LOW CONFIDENCE, ' + colored(
                    'INELIGIBLE FOR NOTCH1 TRIAL', 'red')
            if new == '*':
                mut = 'non'
            else:
                mut = 'mis'
            return read_notch(mut, dom, orig + str(dom) + new)

        # setup mod_cdna
        if 'delins' in cdna:
            mod_cdna = notch_cdna[:pos[0] - 1] + seq + notch_cdna[pos[-1]:]
        elif 'del' in cdna:
            mod_cdna = notch_cdna[:pos[0] - 1] + notch_cdna[pos[-1]:]
        elif 'ins' in cdna:
            mod_cdna = notch_cdna[:pos[0]] + seq + notch_cdna[pos[0]:]
        elif 'dup' in cdna:
            mod_cdna = notch_cdna[:pos[-1]] + seq + notch_cdna[pos[-1]:]
        for x in range(0, (len(mod_cdna) // 3) * 3, 3):
            mod_aa += gencode[mod_cdna[x:x + 3]]
        if mod_aa == notch_aa:
            return colored('INVALID INPUT: SILENT MUTATION DETECTED', 'red')
        for x in range(len(notch_aa)):
            if notch_aa[x] != mod_aa[x]:
                dom = x
                break
        if not inframe:
            mut = 'fs'
            if '*' in mod_aa[dom:]:
                return read_notch(mut, dom, notch_aa[dom] + str(dom + 1) + 'fs*' + str(
                    mod_aa[dom:].index('*')) + '\n')
            else:
                return read_notch(mut, dom, notch_aa[dom] + str(dom + 1) + 'fs*?' + '\n')

        if inframe:
            mut = 'inf'
            if '*' in mod_aa[:len(mod_aa) - 1]:
                return read_notch('non', dom, notch_aa[mod_aa[:len(mod_aa) - 1].index('*')] + str(
                    mod_aa[:len(mod_aa) - 1].index('*') + 1) + '*' + '\n')
            last = dom
            for x in range(-1, len(notch_aa) * -1, -1):
                if notch_aa[x] != mod_aa[x]:
                    last = x
                    break
            off = 0
            if len(mod_aa) > len(notch_aa):
                diff = (len(mod_aa) - len(notch_aa))
                for x in range(len(notch_aa)):
                    if notch_aa[x - off] != mod_aa[x]:
                        if off != diff:
                            notch_aa = notch_aa[:x] + '-' + notch_aa[x:]
                        off += 1
                if off == diff:
                    print(mod_aa[last % len(mod_aa)])
                    return read_notch(mut, dom, notch_aa[dom - 1] + str(dom) + '_' + notch_aa[dom] + str(
                        dom + 1) + 'ins' + mod_aa[dom:(last % len(mod_aa)) + 1])
            elif len(mod_aa) < len(notch_aa):
                diff = (len(notch_aa) - len(mod_aa))
                for x in range(len(mod_aa)):
                    if notch_aa[x] != mod_aa[x] and mod_aa[x] != '-':
                        if off != diff:
                            mod_aa = mod_aa[:x] + '-' + mod_aa[x:]
                        off += 1
                if off == diff:
                    if off == 1:
                        return read_notch(mut, dom, notch_aa[dom] + str(dom + 1) + 'del' '\n')
                    return read_notch(mut, dom, notch_aa[dom] + str(dom + 1) + '_' + notch_aa[last] + str(
                        last % len(notch_aa) + 1) + 'del' '\n')
            else:
                if last == dom:
                    return read_notch('mis', dom, notch_aa[last] + str(dom) + mod_aa[last])
                else:
                    return read_notch('inf', dom, notch_aa[dom - 1] + str(dom) + '_' + notch_aa[last] + str(
                        last + 1) + 'delins' + mod_aa[dom - 1: last + 1])
            if off != diff:
                return read_notch(mut, dom, notch_aa[dom] + str(dom + 1) + '_' + notch_aa[last] + str(
                    last % len(notch_aa) + 1) + 'delins' + mod_aa[dom:last] + '\n')


